import React from "react";
import { CssBaseline } from "@material-ui/core";
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';
import wallpaper from "../components/images/wallpaper.jpeg"
import './Home.css';

const Home = () => {

  return (
    <React.Fragment>
      <CssBaseline />
      <div className="homeContainer">
        <img src={wallpaper} alt="Wallpaper" className="homeImage" />
        <Container style={{ borderStyle: "double" }} maxWidth="xl" className="homeText">
          <h2 className="homeTextName">Woof-Woof</h2>
          <h2 className="homeTextTitle">Let's Just be friends fur-ever </h2>
        </Container>
      </div>
    </React.Fragment>
  );
}

export default Home;
